import React from 'react';

const SignUp = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Right',
		alignItems: 'Right',
		height: '100vh'
	}}
	>
	<h1>Sign Up</h1>
		<label for="uname">User name </label> 
	</div>
);
};

export default SignUp;
